    imageUrl: 'http://hoverbusinessservices.com/cloud/aiifa/media/newsletters/2024/7.jpg',
    linkUrl: 'https://hoverbusinessservices.com/cloud/aiifa/newsletters/2024/July-August-Newsletter-2024.pdf',
